    "nodc-standard-format-intertidal-organisms-and-habitats-f030-data-1974-1980-nodc-accession-00141",nt"isopen":
    false,nt"url": null,nt"notes": "This data type contains data from field
    sampling of marine organismsnin intertidal or subtidal habitats. The data were collected
    tonprovide information about species abundance and distribution.nData from each
    observation may include: cruise and stationninformation such as vessel name, senior
    scientist, position, datenand time; environmental conditions such as surface temperaturenand
    salinity, wind speed and direction, and sea state; sedimentnand habitat descriptors;
    and species identification and organismncounts and measurements. Data may be reported
    for eithernindividual or composite samples. Specimens are identifiednby NODC Taxonomic
    Codes. A text record is available for reportingncomments.",nt"license_title":
